import React from 'react';
import { connect } from 'react-redux';

import Logo from '../../Header/Logo';
import GoogleAuth from '../../GoogleAuth';
import JoinIn from './JoinIn';
import { menuChange } from '../../../actions';

import './Home.scss';

class Home extends React.Component {
    state = { showJoinIn: null };

    componentDidMount() {
        this.props.menuChange('home');
    }

    displayJoinIn = () => {
        console.log('JoinIn');
        if (this.state.showJoinIn) return <JoinIn />;
        else return <div></div>;
    }

    render() {
        this.setState({ showJoinIn: true });
        return (
            <div className="home">
                <div className="join">
                    <Logo />
                    <p>Want to share docs with friends ?!</p>
                    <button>Join Us</button>
                    {this.displayJoinIn()}
                    <GoogleAuth />
                </div>
            </div>
        );
    }
}

export default connect(null, {menuChange})(Home);
